angular.module("bookShelf",["ngRoute","ngMessages","ui.bootstrap"]).config(["$routeProvider",function(o){o.when("/books",{templateUrl:"src/books/book-list.html",controller:"BookListController",controllerAs:"vm"}).when("/login",{templateUrl:"src/login/login.html",controller:"LoginController",controllerAs:"vm"}).otherwise({redirectTo:"/books"})}]).config(["$httpProvider",function(o){o.interceptors.push("LoadingIndicatorInterceptor")}]).run(["AuthService","$location",function(o,r){o.isLoggedIn()||r.path("/login")}]);